    app.factory('Chats', function(Contacts, $firebaseArray) {

        var messagesRef = new Firebase('https://oggr.firebaseio.com/messages');
        var messagesFBA = $firebaseArray(messagesRef);

        var messageOptions = [{
            content: 'Wow, this is really something huh?'
        }, {
            content: 'Yea, it\'s pretty sweet'
        }, {
            content: 'I think I like Ionic more than I like ice cream!'
        }, {
            content: 'Gee wiz, this is something special.'
        }, {
            content: 'data:image/jpeg;base64,'
        }, {
            content: 'https://scontent-sin.xx.fbcdn.net/hphotos-xpf1/v/t1.0-9/168180_485824402701_4783114_n.jpg?oh=5b0be9d4492dca623aa4db8bf3c58c5a&oe=56036982'
        }, {
            content: 'Is this magic?'
        }, {
            content: 'Am I dreaming?'
        }, {
            content: 'https://scontent-sin.xx.fbcdn.net/hphotos-xpa1/v/t1.0-9/68946_10154630841865643_1183282455237224596_n.jpg?oh=4b7cc233aa1001f37d63f4042224aa35&oe=55C94E61'
        }, {
            content: 'Am I dreaming?'
        }, {
            content: 'Yea, it\'s pretty sweet'
        }, {
            content: 'I think I like Ionic more than I like ice cream!'
        }, ];

        var messageIter = 0;

        function createMessage(msg) {
            if (msg) return {
                content: msg
            };
            var nextMessage = messageOptions[messageIter++ % messageOptions.length];
            return angular.extend({}, nextMessage)
        }

        var chats = [];
        //TODO remove
        chats.push(Room(2))
        chats.push(Room(3))

        function Room(contactId) {
            var id = chats.length;

            var room = Object.create({}, {
                id: {
                    writable: true,
                    configurable: true,
                    value: id
                },
                data: {
                    writable: true,
                    configurable: true,
                    value: [createMessage()]
                },
                contacts: {
                    writable: true,
                    configurable: true,
                    value: [contactId]
                },
                messages: {
                    configurable: false,
                    get: function() {
                        //return this.data;
                        return messagesFBA.$loaded()
                    },
                    set: function(msg) {
                        //Keep for initializing
                    }
                },
                nextMessage: {
                    configurable: false,
                    set: function(msg) {
                        messagesFBA.$add(createMessage(msg));
                        //this.data.push(createMessage(msg));
                    }
                },
                previousMessage: {
                    configurable: false,
                    set: function(msg) {
                        this.data.unshift(createMessage(msg));
                    }
                },
                lastMessage: {
                    configurable: false,
                    get: function() {
                        return this.data[this.data.length - 1].content;
                    }
                },

            });

            room.deleteMessage = function(msg) {
                this.data.splice(this.data.indexOf(msg), 1);

            }
            return room;
        };

        return {
            all: function() {
                return chats;
            },
            get: function(chatId) {
                return chats[chatId];
            },
            remove: function(chat) {
                return chats.splice(chats.indexOf(chat), 1);
            },
            create: function(contactId) {
                chats.push(Room(contactId));
                return true;
            }

        };
    });

